function SectionFirst() {
    return (
        <div className="w-full  pt-56 pb-40  ">
           <div className=" flex">
           <div className="w-4/5 flex flex-col justify-center">
                <h2 className=" font-sans text-6xl font-bold text-blue-600">TradEdge<br />Institute</h2>
                <p className="text-xl">Empowering traders with knowledge, strategy, and confidence.</p>
                <div className="pt-4" >
                    <button className=" w-auto h-auto p-2 border-2 rounded-xl  font-sans bg-blue-600 text-white" type="button">ENROLL NOW</button>
                </div>
            </div>
            <div className=" w-full h-full  flex justify-center items-center">
                <div className="w-2/3"> <img className="w-full" src={personalimg} /></div>
            </div>
           </div>

        </div>
    );
}

